public class InnerDataSetDatasetParameterFactory(Action<Humidifier.QuickSight.DataSetTypes.DatasetParameter> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.DataSetTypes.DatasetParameter>
{

    internal InnerDataSetIntegerDatasetParameterFactory IntegerDatasetParameterFactory { get; set; }

    internal InnerDataSetDateTimeDatasetParameterFactory DateTimeDatasetParameterFactory { get; set; }

    internal InnerDataSetDecimalDatasetParameterFactory DecimalDatasetParameterFactory { get; set; }

    internal InnerDataSetStringDatasetParameterFactory StringDatasetParameterFactory { get; set; }

    protected override Humidifier.QuickSight.DataSetTypes.DatasetParameter Create()
    {
        var datasetParameterResult = CreateDatasetParameter();
        factoryAction?.Invoke(datasetParameterResult);

        return datasetParameterResult;
    }

    private Humidifier.QuickSight.DataSetTypes.DatasetParameter CreateDatasetParameter()
    {
        var datasetParameterResult = new Humidifier.QuickSight.DataSetTypes.DatasetParameter();

        return datasetParameterResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.DataSetTypes.DatasetParameter result)
    {
        base.CreateChildren(result);

        result.IntegerDatasetParameter ??= IntegerDatasetParameterFactory?.Build();
        result.DateTimeDatasetParameter ??= DateTimeDatasetParameterFactory?.Build();
        result.DecimalDatasetParameter ??= DecimalDatasetParameterFactory?.Build();
        result.StringDatasetParameter ??= StringDatasetParameterFactory?.Build();
    }

} // End Of Class

